INSERT INTO `brands` (`id`, `name`, `logo`, `description`, `status`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 'Vasvi', '$$$$2b989f0bcf2505ad713985e8f5a1ff50.png', '<p>Vasvi &nbsp;is a ladies Ethnic wear brand having manufacturing unit at Jaipur and chain of Showrooms across India. Currently in Rajasthan, Haryana, Madhya Pradesh, Maharashtra, Telangana states.</p><p>Vasvi a brand of Pyramid Exports Jaipur since its inception had focused on quality,</p><p>affordable prices &amp; latest fashionable attires . In just span of &nbsp;6 years it has a unique and exclusive impact in ethnic wears market. Vasvi has made a special space in wardrobe of elite and fashion oriented modern women\'s.</p><p>With a dedicated team of &nbsp;expertise professionals &amp; designers &nbsp;Vasvi offerings the best and exclusive range of ethnic wears for all seasons and occasions.</p><p>Vasvi USP &nbsp;is to reach from direct &nbsp;manufacturing house to fashion lovers customer at lowest price with excellent quality and fashion.</p>', 1, NULL, '2021-12-04 21:09:18', NULL);
