rd drive.</p><p>&nbsp;</p><p>Like many sites, we use \"cookies\" to collect information. You can instruct your browser to refuse all cookies or to indicate when a cookie is being sent. However, if you do not accept cookies, you may not be able to use some portions of our Site.</p><p>&nbsp;</p><p>Security</p><p>&nbsp;</p><p>The security of your Personal Information is important to us, but remember that no method of transmission over the Internet, or method of electronic storage, is 100% secure. While we strive to use commercially acceptable means to protect your Personal Information, we cannot guarantee its absolute security.</p><p>&nbsp;</p><p>Changes to This Privacy Policy</p><p>&nbsp;</p><p>This Privacy Policy is effective as of 1/12/2021 and will remain in effect except with respect to any changes in its provisions in the future, which will be in effect immediately after being posted on this page.</p><p>&nbsp;</p><p>We reserve the right to update or change our Privacy Policy at any time and you should check this Privacy Policy periodically. Your continued use of the Service after we post any modifications to the Privacy Policy on this page will constitute your acknowledgment of the modifications and your consent to abide and be bound by the modified Privacy Policy.</p><p>&nbsp;</p><p>If we make any material changes to this Privacy Policy, we will notify you either through the email address you have provided us, or by placing a prominent notice on our website.</p><p>&nbsp;</p><p>Contact Us</p><p>&nbsp;</p><p>If you have any questions about this Privacy Policy, please contact us on info@vasvi.in</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p>', 1, '2021-11-11 16:22:29', '2021-12-21 01:05:56', NULL),
(4, 1, 'Return Policy', 'Return Policy', 'return-policy', '/return-policy', 'https://vasvi.in/file/16390301796mijNby3.png', 'Vasvi - Return Policy', 'Thanks for purchasing our products at www.vasvi.in operated by VASVI\r\nIn order to be eligible for a refund, you have to return the product within 15 calendar days of your purchase. The product must be in the same condition that you receive it and undamaged in any way.\r\nAfter we receive your item, our team of professionals will inspect it and process your refund. The money will be refunded to the original payment method you’ve used during the purchase. For credit card payments it may take 7 business days for a refund to show up on your credit card statement.\r\nIf the product is damaged in any way, or you have initiated the return after 15 calendar days have passed, you will not be eligible for a refund. \r\nIf anything is unclear or you have more questions feel free to contact our customer support team on email or WhatsApp chat.', 'Thanks for purchasing our products at www.vasvi.in operated by VASVI\r\nIn order to be eligible for a refund, you have to return the product within 15 calendar days of your purchase. The product must be in the same condition that you receive it and undamaged in any way.\r\nAfter we receive your item, our team of professionals will inspect it and process your refund. The money will be refunded to the original payment method you’ve used during the purchase. For credit card payments it may take 7 business days for a refund to show up on your credit card statement.\r\nIf the product is damaged in any way, or you have initiated the return after 15 calendar days have passed, you will not be eligible for a refund. \r\nIf anything is unclear or you have more questions feel free to contact our customer support team on email or WhatsApp chat.', 'Return Product, Desclaration', '<p>Thanks for purchasing our products at www.vasvi.in operated by VASVI</p><p>In order to be eligible for a refund, you have to return the product within 15 calendar days of your purchase. The product must be in the same condition that you receive it and undamaged in any way.</p><p>After we receive your item, our team of professionals will inspect it and process your refund. The money will be refunded to the original payment method you’ve used during the purchase. For credit card payments it may take 7 business days for a refund to show up on your credit card statement.</p><p>If the product is damaged in any way, or you have initiated the return after 15 calendar days have passed, you will not be eligible for a refund. &nbsp;</p><p>If anything is unclear or you have more questions feel free to contact our customer support team on email or WhatsApp chat.</p><p>&nbsp;</p>', 1, '2021-11-18 01:28:00', '2021-12-09 17:06:18', NULL),
(11, 1, 'Franchise', 'Franchise', 'franchise-vasvi', '/franchise-vasvi', 'https://vasvi.in/file/16390301796mijNby3.png', 'Vasvi', 'Vasvi', 'VASVI is that brand which is publicly distinguished from others because of their products services and concepts so that it can be easily commutated and usually marketed. \r\n\r\nVASVI offers fashion and quality at the best price but with in a economic price segment. \r\n\r\nFocuses to detail ready to wear design.\r\n\r\nSatisfying the fashion enthusiasts of India with Modern and trendy apparel.\r\n\r\nBrand has redefined the traditional Indian outfit for women of all ages, Who effortlessly balance work and home life looking there best.\r\n\r\nBrand Create standards and gives significant importance to the quality, Durability and  value for money which reaches the demands of customers and gives satisfaction for the  money spend by them.\r\n\r\nDifferent and unique designs, Trendy and fashionable , Carried for the sake of fashion.', 'Vasvi', '<p>VASVI is that brand which is publicly distinguished from others because of their products services and concepts so that it can be easily commutated and usually marketed.</p><p>&nbsp;</p><p>VASVI offers fashion and quality at the best price but with in a economic price segment.</p><p>&nbsp;</p><p>Focuses to detail ready to wear design.</p><p>&nbsp;</p><p>Satisfying the fashion enthusiasts of India with Modern and trendy apparel.</p><p>&nbsp;</p><p>Brand has redefined the traditional Indian outfit for women of all ages, Who effortlessly balance work and home life looking there best.</p><p>&nbsp;</p><p>Brand Create standards and gives significant importance to the quality, Durability and &nbsp;value for money which reaches the demands of customers and gives satisfaction for the &nbsp;money spend by them.</p><p>&nbsp;</p><p>Different and unique designs, Trendy and fashionable , Carried for the sake of fashion.</p>', 1, '2021-12-09 17:23:17', '2021-12-09 17:26:56', NULL);
