(9, 1, 2, 'Privacy Policy', '/privacy-policy', '<p>Pyramid Exports we operates http://www.vasvi.in website. This page informs you of our policies regarding the collection, use and disclosure of Personal Information we receive from users of the Site.</p><p>&nbsp;</p><p>We use your Personal Information only for providing and improving the Site. By using the Site, you agree to the collection and use of information in accordance with this policy.</p><p>&nbsp;</p><p>Information Collection and Use</p><p>&nbsp;</p><p>While using our Site, we may ask you to provide us with certain personally identifiable information that can be used to contact or identify you. Personally identifiable information may include, but is not limited to your name (\"Personal Information\").</p><p>&nbsp;</p><p>Log Data</p><p>&nbsp;</p><p>Like many site operators, we collect information that your browser sends whenever you visit our Site (\"Log Data\").</p><p>&nbsp;</p><p>This Log Data may include information such as your computer\'s Internet Protocol (\"IP\") address, browser type, browser version, and the pages of our Site that you visit, the time and date of your visit, the time spent on those pages and other statistics.</p><p>&nbsp;</p><p>In addition, we may use third party services such as Google Analytics that collect, monitor and analyse this …</p><p>&nbsp;</p><p>Communications</p><p>We may use your Personal Information to contact you with newsletters, marketing or promotional materials and other information that...</p><p>&nbsp;</p><p>Cookies</p><p>Cookies are files with small amount of data, which may include an anonymous unique identifier. Cookies are sent to your browser from a web site and stored on your computer\'s hard drive.</p><p>&nbsp;</p><p>Like many sites, we use \"cookies\" to collect information. You can instruct your browser to refuse all cookies or to indicate when a cookie is being sent. However, if you do not accept cookies, you may not be able to use some portions of our Site.</p><p>&nbsp;</p><p>Security</p><p>&nbsp;</p><p>The security of your Personal Information is important to us, but remember that no method of transmission over the Internet, or method of electronic storage, is 100% secure. While we strive to use commercially acceptable means to protect your Personal Information, we cannot guarantee its absolute security.</p><p>&nbsp;</p><p>Changes to This Privacy Policy</p><p>&nbsp;</p><p>This Privacy Policy is effective as of 1/12/2021 and will remain in effect except with respect to any changes in its provisions in the future, which will be in effect immediately after being posted on this page.</p><p>&nbsp;</p><p>We reserve the right to update or change our Privacy Policy at any time and you should check this Privacy Policy periodically. Your continued use of the Service after we post any modifications to the Privacy Policy on this page will constitute your acknowledgment of the modifications and your consent to abide and be bound by the modified Privacy Policy.</p><p>&nbsp;</p><p>If we make any material changes to this Privacy Policy, we will notify you either through the email address you have provided us, or by placing a prominent notice on our website.</p><p>&nbsp;</p><p>Contact Us</p><p>&nbsp;</p><p>If you have any questions about this Privacy Policy, please contact us on info@vasvi.in</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p>', '2021-11-13 04:02:22', '2021-11-13 04:02:22'),
(11, 1, 4, 'Return Policy', '/return-policy', '<p>Thanks for purchasing our products at www.vasvi.in operated by VASVI</p><p>In order to be eligible for a refund, you have to return the product within 15 calendar days of your purchase. The product must be in the same condition that you receive it and undamaged in any way.</p><p>After we receive your item, our team of professionals will inspect it and process your refund. The money will be refunded to the original payment method you’ve used during the purchase. For credit card payments it may take 7 business days for a refund to show up on your credit card statement.</p><p>If the product is damaged in any way, or you have initiated the return after 15 calendar days have passed, you will not be eligible for a refund. &nbsp;</p><p>If anything is unclear or you have more questions feel free to contact our customer support team on email or WhatsApp chat.</p><p>&nbsp;</p>', '2021-11-18 01:28:00', '2021-11-18 01:28:00'),
