INSERT INTO `products` (`id`, `user_id`, `category_id`, `sub_category_id`, `sub_category_child_id`, `name`, `description`, `details`, `care_and_disclaimer`, `slug`, `sku_code`, `hsn_code`, `mrp_price`, `tax_rate`, `discount_type`, `discount`, `in_stock`, `is_exclusive`, `is_featured`, `is_new`, `is_bulk`, `sales_price`, `view_count`, `status`, `created_at`, `updated_at`, `deleted_at`) VALUES
(157, 1, 1, 3, 27, 'EMBROIDERED COMBO', '<p>Ideal to wear all through the year, this dobby kurta set is sure to become your favourite in no time . Including a embroidered yoke kurta, a solid palazzos with embroidered border , this set is sure to become your favourite.</p>', '<p>Embroidered Yoke Kurta Pant Set</p>', '<p>DRY CLEAN ONLY</p>', 'embroidered-combo', 'CS614', '6104', 2449.00, 3.00, NULL, NULL, 1, 1, 1, 1, 0, 2449.00, 0, 1, '2021-12-03 14:59:19', '2021-12-15 22:53:51', NULL),
(158, 1, 1, 3, 59, 'FLARE TUNIC DHOTI SET', '<p><br />\r\nElegance with a touch of artistry, this combo set is perfect to amp-up your personal style on the ethnic front. Decked with intricate&nbsp; floral aari embroiderey design on placket on the classic english green base, its beauty lies in its minimalism. With the smart styling of kalidaar santoon tunic and the accompaniment ankle length breezy rayon dhoti, this set is the epitomy of style meets traditions!&nbsp;</p>', '<p>Embellished Placket Kalidaar Tunic Dhoti Set</p>', '<p>DRYCLEAN ONLY</p>', 'flare-tunic-dhoti-set', 'CS1350', '6104', 3299.00, NULL, NULL, NULL, 1, 1, 1, 1, 0, 3299.00, 0, 1, '2021-12-03 15:31:29', '2021-12-03 15:31:29', NULL),
(159, 1, 1, 3, 59, 'RED ANGARAKHA SHARARA SET', '<p>Create an oomph factor in your occasions by this gold embossing rayon short angarakha kurta with inticate handmede tassels paired with gold and vibrant colorerd breezy tire cotton sharara .</p>', '<p>Red Short Angarakha Tire Sharara Set</p>', '<p>DRYCLEAN ONLY</p>', 'red-angarakha-sharara-set', 'CS1457', '6104', 2849.00, NULL, NULL, NULL, 1, 0, 0, 0, 0, 2849.00, 0, 1, '2021-12-03 15:43:52', '2021-12-03 15:43:52', NULL),
(160, 1, 1, 54, 72, 'CHANDERI 3 PC SET', '<p>Looking to shine in a party , go for this party wear 3 pc set . Kurta having aari embroidery with sequence work constructed on lustrous chanderi butti fabric paired with chanderi kalidar palazo for your comfort accompanied ombre chiffon dupatta with attached hand made tassels.</p>', '<p>Embroidered Chanderi Kurta 3 Pc Suit Set</p>', '<p>DRY CLEAN ONLY</p>', 'chanderi-3-pc-set', 'CS1182', '6104', 3499.00, NULL, NULL, NULL, 1, 1, 1, 1, 0, 3499.00, 0, 1, '2021-12-03 15:49:45', '2021-12-08 17:37:32', NULL),
(161, 1, 1, 54, 72, 'ZARI EMBROIDERED KURTA SET', '<p>This suit set is completed with aari embroidery on lustrous malai silk kurta featuring a straight silhouette and three-quarter sleeves along with a pair of kalidar&nbsp; palazzos having block print and a silk dupatta to complete the ensemble.</p>', '<p>Embroidered Kurta Kalidar Palazo Suit Set</p>', '<p>DRYCLEAN ONLY</p>', 'zari-embroidered-kurta-set', 'CSD1202', '6104', 3599.00, NULL, NULL, NULL, 1, 1, 1, 1, 0, 3599.00, 0, 1, '2021-12-03 16:09:33', '2021-12-03 16:09:33', NULL),
(162, 1, 1, 3, 27, 'RAYON SLUB KURTA SET', '<p>The subtle embroidery on placket and collor with its ethnic undertones renders this piece its fashion essence. A casual party wear which you can accessorize into a festive wear, the run-through patterned on the front further highlights the simplistic silhouette on rayon slub with gold print and comfortable breezy palazo&nbsp;</p>', '<p>Embroidered Placket Aline Kurta Set</p>', '<p>DRY CLEAN ONLY</p>', 'rayon-slub-kurta-set', 'CS1139', '6104', 2199.00, NULL, NULL, NULL, 1, 1, 1, 1, 0, 2199.00, 0, 1, '2021-12-03 17:25:31', '2021-12-03 17:25:31', NULL),
