(214, 1, 1, 9, 62, 'WOOLEN DRESS', '<p>Winter staples have a way of staying relevant through any season and this checks dress is just that. The fit and flare silhouette flaunts a hand work intricate motif finish and flows comfortably with long sleeves .</p>', '<p>Embroidered Woolen Flare Dress</p>', NULL, 'woolen-dress', 'DR1491', '6104', 3299.00, 12.00, NULL, NULL, 1, 1, 1, 1, 0, 3299.00, 0, 1, '2021-12-16 20:37:51', '2021-12-25 21:30:31', NULL),
(215, 1, 1, 2, 56, 'GOLD PRINT KURTA', '<p>A must-have festive addition to your closet is this kurta . Milled from an extremely lightweight rayon material that feels gentle on the skin, the straight kurta works gold motif prints for a feminine touch whilst the slit pocket renders practicality.</p>', '<p>Gold Print Straight Kurta</p>', NULL, 'gold-print-kurta-1-1', 'SK338', '6104', 999.00, 12.00, NULL, NULL, 1, 1, 1, 1, 0, 999.00, 0, 1, '2021-12-16 21:22:21', '2021-12-25 22:24:32', NULL),
(216, 1, 1, 2, 55, 'BLOCK PRINT KURTA', '<p>Cherish your festive days in this sartorially-forward oink hued kurta . Carved in a fit-and-flare contour from a soft yarn dyed material, this round -neck creation showcases dainty hand block gold print in the front and sleeves for a graceful twist.</p>', '<p>Block Print Aline Kurta</p>', NULL, 'block-print-kurta', 'AL1332', '6104', 1299.00, 12.00, NULL, NULL, 1, 1, 1, 1, 0, 1299.00, 0, 1, '2021-12-16 21:31:14', '2021-12-25 22:26:41', NULL),
(217, 1, 1, 3, 27, 'COTTON COMBO', '<p>Tailored out of 100% premium cotton, this set offers breathable comfort as you breeze through your busy days. The chic tone of summer blues and round hand work placket neckline, pockets in pants, and the classy 3/4th sleeves add to the utilitarian vibe of this piece. The kurta is complemented with a pair of blue stripe pants to create a visually appealing look.</p>', '<p>Printed Kurta Pant Set</p>', NULL, 'cotton-combo', 'CS1211', '6104', 1599.00, 12.00, NULL, NULL, 1, 1, 1, 1, 0, 1599.00, 0, 1, '2021-12-16 21:39:58', '2021-12-25 22:34:33', NULL),
