(223, 1, 1, 9, 62, 'CHECKS EMBROIDERED DRESS', '<p>Make a flattering addition to your wardrobe with this shirtdress. Spun from a soft-to-touch breathable fabric, this fit-and-flare creation comes minimally fashioned with a button-down front along with a belt for a proportioned fit.</p>', '<p>Embroidered Checks Aline Dress</p>', NULL, 'checks-embroidered-dress', 'DR104', '6104', 1145.00, 12.00, NULL, NULL, 1, 1, 1, 0, 0, 1145.00, 0, 1, '2021-12-17 16:48:30', '2021-12-24 19:20:50', NULL),
