(227, 1, 1, 2, 56, 'FOIL PRINT KURTA', '<p>Infuse a dash of playfulness to your festive ensemble with this kurta from . Milled from a breathable fabric into an straight&nbsp; profile, it showcases floral patterns with foil print detailing for contemporary charm. Pair this with off-white palazzos and sandals for a fresh look.</p>', '<p>Foil Print Straight Kurta</p>', NULL, 'foil-print-kurta', 'SK321', '6104', 999.00, 12.00, NULL, NULL, 1, 1, 1, 0, 0, 999.00, 0, 1, '2021-12-17 17:55:39', '2021-12-25 21:52:41', NULL),
(228, 1, 1, 9, 62, 'PRINTED LAYER DRESS', '<p>Reminiscent of its chic influence, the blue white rayon dress comes in a unique double layer jacket silhouette. Tailored in plush rayon fabric, this sleeveless dress can be paired with wgite legging for ethenic look.</p>', '<p>Printed Double Layer Dress</p>', NULL, 'printed-layer-dress', 'DR324', '6104', 1249.00, 12.00, NULL, NULL, 1, 1, 1, 1, 0, 1249.00, 0, 1, '2021-12-17 18:03:18', '2021-12-25 22:22:24', NULL),
(229, 1, 1, 2, 55, 'PRINTED ALINE KURTA', '<p>Imbue feminine vibes into your ethnic styling with this grey kurta . Sculpted in an A-line silhouette from an ultra lightweight material, this mandarin-collared creation has pockets and spotlights abstract patterns all over for a refreshing touch.</p>', '<p>Front Placket Aline Kurta</p>', NULL, 'printed-aline-kurta', 'AL330', '6104', 1245.00, 12.00, NULL, NULL, 1, 1, 1, 1, 0, 1245.00, 0, 1, '2021-12-17 18:10:30', '2021-12-25 21:33:27', NULL),
(230, 1, 1, 4, 28, 'EMBROIDERED TOP', '<p>Add a playful twist to your casual capsule with this teal cropped top .Whipped in a pure-Rayon profile for uninterrupted breathability, the garment sports a floral embroidery on bodice for a stylish finish.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '<p>Embroidered Flare Top</p>', NULL, 'embroidered-top', 'TP340', '6104', 899.00, 12.00, NULL, NULL, 1, 1, 1, 0, 0, 899.00, 0, 1, '2021-12-17 18:16:19', '2021-12-24 20:49:17', NULL),
(231, 1, 1, 2, 56, 'SOLID ALINE KURTA', '<p>Add a timeless charm to your casual office wear with this grey kurta . Designed from a lightweight breathable yarn dyed cotton fabric for optimum comfort, the diaphanous kurta features detailed hand work, dainty buttoning and three fourth sleeves with cuffs for an added charm.</p>', '<p>Front Placket Aline Kurta</p>', NULL, 'solid-aline-kurta-1', 'SK371', '6104', 1145.00, 12.00, NULL, NULL, 1, 1, 1, 1, 0, 1145.00, 0, 1, '2021-12-18 15:06:23', '2021-12-24 20:36:24', NULL),
(232, 1, 1, 2, 56, 'SOLID STRAIGHT KURTA', '<p>Revamp your ethnic capsule with minimalistic styles such as this orange kurta&nbsp; . Shaped in an straight&nbsp; frame&nbsp; for unrestricted comfort, this piece comes fitted with a button-down front placket for practical appeal and is finished with regular sleeve</p>', '<p>Solid Casual Straight Kurta</p>', NULL, 'solid-straight-kurta', 'SK396', '6104', 1199.00, 12.00, NULL, NULL, 1, 1, 1, 1, 0, 1199.00, 0, 1, '2021-12-18 15:21:42', '2021-12-24 19:50:17', NULL),
