(247, 1, 1, 2, 56, 'SOLID KURTA', '<p>Revamp your ethnic capsule with minimalistic styles such as this coral kurta . Shaped in a straight frame from rayon flex material for unrestricted comfort, this piece comes fitted with a button-down front placket for practical appeal and is finished with knot sleeve</p>', '<p>Solid Rayon Casual Kurta</p>', NULL, 'solid-kurta-1', 'SK56', '6104', 999.00, 12.00, NULL, NULL, 1, 1, 1, 0, 0, 999.00, 0, 1, '2021-12-20 16:56:16', '2021-12-24 19:44:35', NULL),
(248, 1, 1, 9, 62, 'MULTI CHECKS DRESS', '<p>Make a flattering addition to your wardrobe with this multi checks shirtdress . Spun from a soft-to-touch breathable fabric, this fit-and-flare creation comes minimally fashioned with a button-down front along with a belt for a proportioned fit.</p>', '<p>Front Placket Aline Dress</p>', NULL, 'multi-checks-dress', 'DR103', '6104', 1145.00, 12.00, NULL, NULL, 1, 1, 1, 0, 0, 1145.00, 0, 1, '2021-12-20 17:00:39', '2021-12-24 19:19:42', NULL),
