(255, 1, 1, 94, 95, 'PRINTED SHIRT NIGHT SUIT', '<p>Transport yourself to the era of retro finesse by opting for this coordinated white night-suit. Working abstract floral patterns all over the pure-cotton composition for a chic twist, the set includes a notched-lapel shirt and full-length pajamas with classy shell button for added appeal.</p>', '<p>Printed Shirt Pant Night Suit</p>', NULL, 'printed-shirt-night-suit', 'NS1247', '6104', 1649.00, 12.00, NULL, NULL, 1, 1, 1, 0, 0, 1649.00, 0, 1, '2021-12-27 17:07:55', '2021-12-27 17:07:55', NULL),
(256, 1, 1, 94, 95, 'PRINTED POLKA DOT SHIRT SET', '<p>Transport yourself to the era of retro finesse by opting for this coordinated yellow night-suit . Working polkadot patterns all over the pure-cotton composition for a chic twist, the set includes a notched-lapel shirt and full-length pajamas with classy shell button for added appeal.</p>', '<p>Printed Polka Shirt Pajama Set</p>', NULL, 'printed-polka-dot-shirt-set', 'ns1494', '6104', 1499.00, 12.00, NULL, NULL, 1, 1, 1, 1, 0, 1499.00, 0, 1, '2021-12-27 17:15:29', '2021-12-27 17:15:29', NULL),
(257, 1, 1, 2, 56, 'PRINTED STRAIGHT KURTA', '<p>A trendy and stylish separate to take you through the day, is this kantha dobby kurta . Cut in a breezy straight contour from a cotton material, this round v neck separate is covered with mughal motif prints for a contemporary finishing touch.</p>', '<p>Printed Kantha Dobby Kurta</p>', NULL, 'printed-straight-kurta-1', 'SK1366', '6104', 999.00, 12.00, NULL, NULL, 1, 1, 1, 0, 0, 999.00, 0, 1, '2021-12-27 17:24:21', '2021-12-27 17:24:21', NULL),
(258, 1, 1, 94, 95, 'PRINTED SHIRT NIGHT SUIT', '<p>For a cozy feeling as you wind up your days, pick this night-suit . The coordinated set of a shirt and full-length pajamas comes to life with tonal turquoise polka prints while the classy shell button lends a retro twist. The pure-cotton composition feels sumptuously soft against the skin.</p>', '<p>Printed Shirt Pajama Set</p>', NULL, 'printed-shirt-night-suit-1', 'ns1348', '6104', 1499.00, 12.00, NULL, NULL, 1, 1, 1, 1, 0, 1499.00, 0, 1, '2021-12-27 17:27:32', '2021-12-27 17:27:32', NULL),
(259, 1, 1, 4, 60, 'PRINTED SHIRT TUNIC', '<p>Channel a confident look with this black long shirt tunic . The structured silhouette with its collar and gather sleeves showcases a mix of feminine allure with added suave. Pair it with tailored pants for an on-point finish.</p>', '<p>Printed Shirt Style Long Tunic</p>', NULL, 'printed-shirt-tunic', 'TU1515', '6104', 1149.00, 12.00, NULL, NULL, 1, 1, 1, 1, 0, 1149.00, 0, 1, '2021-12-27 17:34:26', '2021-12-27 17:34:26', NULL),
(260, 1, 1, 94, 95, 'RAYON NIGHT WEAR', '<p>Perfect for a slumber party with your girlfriends is this midnight blue set . Milled from a soft rayon fabric for endless comfort, the top and pyjamas set work abstract motif all over for contemporary charm .</p>', '<p>Rayon Top Pant Night Wear</p>', NULL, 'rayon-night-wear-1-1-1-1-1', 'NS1520', '6104', 1499.00, 12.00, NULL, NULL, 1, 1, 1, 0, 0, 1499.00, 0, 1, '2021-12-27 17:37:22', '2021-12-27 17:37:22', NULL),
(261, 1, 1, 2, 26, 'STRIPES KURTA', '<p>Add a touch of finesse to your office rotation with this black kurta . Flaunting a broad stripes pattern all over, this straight silhouette features a band collor neckline and slip pocket for functionality. The yarn dyed-cotton composition renders unlimited comfort</p>', '<p>Stripes Front Placket Kurta</p>', NULL, 'stripes-kurta', 'SK1505', '6104', 849.00, 12.00, NULL, NULL, 1, 1, 1, 0, 0, 849.00, 0, 1, '2021-12-27 18:34:35', '2021-12-27 18:34:35', NULL),
(262, 1, 1, 3, 27, 'EMBELLISHED COMBO', '<p>Enrich your summer festive collection with this light green ethnic set . Highlighting zardozi work at the bodice along with gold boota prints throughout, the lightweight kurta is cut to a traditional straight frame. It is accompanied by cotton schiffly pants to complete the elegant ensemble.</p>', '<p>Embellished Kurta With Schiffly Pants</p>', NULL, 'embellished-combo-1-1', 'CS628', '6104', 2199.00, 11.99, NULL, NULL, 1, 1, 1, 1, 0, 2199.00, 0, 1, '2021-12-27 20:19:20', '2021-12-27 20:19:20', NULL),
(263, 1, 1, 2, 55, 'EMBROIDERED ALINE KURTA', '<p>Introduce modern elements into your ethnic selection with this green kurta . Carved in an A-line contour with a tail-hem for added appeal, it couples embroidery designs&nbsp; for chic charm while the sumptuous rayon flex blend promises a breathable feel.</p>', '<p>Embroidered Double Layer Kurta</p>', NULL, 'embroidered-aline-kurta', 'al1172', '6104', 2499.00, 12.00, NULL, NULL, 1, 1, 1, 0, 0, 2499.00, 0, 1, '2021-12-27 20:24:07', '2021-12-27 20:24:07', NULL),
(264, 1, 1, 2, 56, 'EMBROIDERED YOKE  KURTA', '<p>Take a regal stand at your next function with this rayon dobby kurta . Decked with intricate embroidery work at the bodice which is highlighted by zardoi and pearl adda work , this straight kurta is aslo highlighted at sleeves to complete the look.</p>\r\n\r\n<p>&nbsp;</p>', '<p>Embroidered Straight Kurta</p>', NULL, 'embroidered-yoke-kurta-1', 'SK1242', '6104', 1799.00, 12.00, NULL, NULL, 1, 1, 1, 0, 0, 1799.00, 0, 1, '2021-12-27 20:33:50', '2021-12-27 20:33:50', NULL),
(265, 1, 1, 2, 56, 'EMBROIDERED KURTA', '<p>Introduce modern elements into your ethnic selection with this green kurta . Carved in a straight contour which is coupled with embroidery designs&nbsp; for chic charm while the sumptuous rayon flex blend promises a breathable feel.</p>', '<p>Embroidered Straight Kurta</p>', NULL, 'embroidered-kurta-1', 'sk1250', '6104', 1599.00, 12.00, NULL, NULL, 1, 1, 1, 0, 0, 1599.00, 0, 1, '2021-12-27 20:36:50', '2021-12-27 20:36:50', NULL),
(266, 1, 1, 54, 72, 'EMBELLISHED KURTA SHARARA SET', '<p>Ideal for the upcoming festive season is this peach ethnic set from Vasvi. The straight jacquard kurta is detailed with hand work on neckline, whilst santoon sharar is adorned with opulent gold hand block print. The outfit is offset by the ombre lustrous chanderi dupatta for regal elegance</p>', '<p>Jacquard Kurta Sharara Dupatta Set</p>', NULL, 'embellished-kurta-sharara-set', 'CSD1337', '6104', 3999.00, 12.00, NULL, NULL, 1, 1, 1, 1, 0, 3999.00, 0, 1, '2021-12-27 21:02:23', '2021-12-27 21:02:23', NULL),
(267, 1, 1, 3, 57, 'HANDLOOM KURTA DUPATTA SET', '<p>Exuding opulent feminine appeal in copious amounts is this red handloom kurta dupatta set. Showcasing intricate floral adda work at the bodice, the kurta flaunts a fit frame for a flattering look. Accompanied by a mughal print patterned chanderi dupatta, your festive attire just got more regal.</p>', '<p>Adda Work Kurta Chanderi Dupatta set</p>', NULL, 'handloom-kurta-dupatta-set', 'KD1370', '6104', 3249.00, 12.00, NULL, NULL, 1, 1, 1, 1, 0, 3249.00, 0, 1, '2021-12-27 21:06:56', '2021-12-27 21:06:56', NULL),
(268, 1, 1, 2, 56, 'GOLD PRINT KURTA', '<p>&nbsp;Introduce feminine chicness into your ethnic rotation by selecting this kurta. Imbued with gold abstract prints all over for a hint of stylishness, this straight separate is fashioned with gold sequence border as well as v neck.</p>', '<p>Gold Print Straight Kurta</p>', NULL, 'gold-print-kurta-1-1-1', 'SK1506', '6104', 1349.00, 12.00, NULL, NULL, 1, 1, 1, 1, 0, 1349.00, 0, 1, '2021-12-27 22:20:40', '2021-12-27 22:20:40', NULL),
(269, 1, 1, 9, 62, 'PRINTED TIRE DRESS', '<p>A contemporary addition to your going-out wear line-up is this black dress . Spun from a breathable fabric with three-fourth sleeves for added appeal, the tiered profile highlights mughal boota and jaal prints and multiple tiers for a touch of chic style.</p>', '<p>Printed Long Tire Dress</p>', NULL, 'printed-tire-dress', 'DR1517', '6104', 1999.00, 12.00, NULL, NULL, 1, 1, 1, 1, 0, 1999.00, 0, 1, '2021-12-27 22:27:19', '2021-12-27 22:27:19', NULL);
